import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';

import { IonicModule } from '@ionic/angular';

import { RecipePage3PageRoutingModule } from './recipe-page3-routing.module';

import { RecipePage3Page } from './recipe-page3.page';

@NgModule({
  imports: [
    CommonModule,
    FormsModule,
    IonicModule,
    RecipePage3PageRoutingModule
  ],
  declarations: [RecipePage3Page]
})
export class RecipePage3PageModule {}
